Loi du 6 février 2025 portant :
1° mise en œuvre du règlement (UE) 2023/606 du Parlement européen et du Conseil du 15 mars 2023 modifiant le règlement (UE) 2015/760 en ce qui concerne les exigences relatives aux politiques dinvestissement et aux conditions de fonctionnement des fonds européens d’investissement à long terme et la définition des actifs éligibles à l’investissement, les obligations en matière de composition et de diversification du portefeuille et l’emprunt de liquidités et d’autres dispositions des statuts des fonds ;
